SELECT DISTINCT(metadata)
FROM cybersyn.sec_report_attributes
WHERE company_name = 'APPLE INC' AND measure_description = 'Net sales';

SELECT DISTINCT METADATA
FROM CYBERSYN.SEC_REPORT_ATTRIBUTES
WHERE CIK = (
    SELECT CIK FROM CYBERSYN.SEC_CIK_INDEX WHERE COMPANY_NAME = 'Alphabet'
) AND STATEMENT = 'Income Statement';

SELECT COUNT(*)
FROM SEC_CIK_INDEX
WHERE SIC_CODE_CATEGORY = 'Airline';

SELECT COUNT(DISTINCT COMPANY_NAME) 
FROM SEC_CIK_INDEX 
WHERE SIC_CODE_DESCRIPTION LIKE '%Airline%';

SELECT count(distinct company_name)
FROM   cybersyn.sec_cik_index
WHERE  sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT COUNT(DISTINCT company_name) AS airline_count
FROM cybersyn.sec_cik_index
WHERE sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT count(distinct company_name) as company_count
FROM   cybersyn.sec_cik_index
WHERE  sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT COUNT(*)
FROM cybersyn.sec_cik_index
WHERE sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT COUNT(DISTINCT company_name) AS num_airline_companies
FROM cybersyn.sec_cik_index
WHERE sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT COUNT(DISTINCT company_name) 
FROM cybersyn.sec_cik_index 
WHERE sic_code_description = 'AIR TRANSPORTATION, SCHEDULED';

SELECT COUNT(*)
FROM SEC_CIK_INDEX
WHERE COMPANY_NAME LIKE '%Chipotle%';

SELECT DISTINCT VARIABLE 
FROM SEC_REPORT_ATTRIBUTES 
WHERE CIK = '0000320193' AND VARIABLE IS NOT NULL;

SELECT DISTINCT VARIABLE
FROM SEC_REPORT_ATTRIBUTES
WHERE CIK IN (SELECT CIK FROM SEC_CIK_INDEX WHERE COMPANY_NAME = 'Apple');

SELECT measure_description
FROM cybersyn.sec_report_attributes
WHERE cik = '0000320193';

SELECT DISTINCT measure_description
FROM cybersyn.sec_report_attributes
WHERE cik IN (SELECT cik FROM cybersyn.sec_cik_index WHERE company_name = 'APPLE INC.');
